import React from 'react'
import style from 'styled-components';

const NominateTitle = style.h1`

  color: white;
  font-weight: bold;
  text-align: left;
  font-size: 48px;

`;

const Form = style.input`

    width: 743px;
    height: 31px;
    background-color: transparent;
    border-size: 0px;
    border-style: solid;
    border-bottom: 1px 

    &::placeholder {
        color: white;
        font-weight: bold;
    }

`;

const Wrapper = style.div`

  margin: 0 22% 0 22%;

`;

export default function Nominate() {
    return (
        <Wrapper>
            <NominateTitle>
                Start Nominating
            </NominateTitle>
            <Form placeholder="Type in the film title (or not up to you)">

            </Form>
        </Wrapper>
    );
}
